import axios from "axios";

export class PersonaService{
    baseUrl="http://localhost:30902/api"
    getAll(){
        return axios(this.baseUrl+"/hello", {
            method: 'GET',
            mode: 'no-cors',
            headers: {
              'Access-Control-Allow-Origin': '*',
              'Content-Type': 'application/json',
            }}).then(res => res.data)
    }
}
